import logo from './logo.svg';
import './App.css';
import AdminNavbar from "./components/navbar";
import VerticalBar from './components/graphs'
import { Container, Row, Col } from "react-bootstrap";


function App() {
  return (
    <div className="App">
          <AdminNavbar />
          <Container fluid>

  <Row md={4} style={{margin:'10px'}}>
    <Col className='box' md={7} style={{background: '#FFFFFF 0% 0% no-repeat',boxShadow: '0px 3px 6px #00000029',borderRadius: '6px',margin:'0px'}}>   
           <VerticalBar /></Col>
    <Col className='box' md={5}  style={{background: '#FFFFFF 0% 0% no-repeat',boxShadow: '0px 3px 6px #00000029',borderRadius: '6px',margin:'0px'}}>  <VerticalBar /></Col>
  </Row>
</Container>
    </div>
  );
}

export default App;
